import React from "react";
import Card from "@mui/material/Card";
import SoftBox from "components/SoftBox";
import SoftTypography from "components/SoftTypography";
import SoftInput from "components/SoftInput";
// import Softcaption from "components/Softcaption";
import { Box, Icon, TextField } from "@mui/material";
import AccountCircle from "@mui/icons-material/AccountCircle";
const Infleta = () => {
  return (
    <Card>
      <SoftBox display="flex" justifyContent="space-between" alignItems="center" p={3}>
        <SoftBox>
          <SoftTypography variant="h6" gutterBottom>
            Â¿Cuotas o Contado?
          </SoftTypography>
          <SoftBox display="flex" gap={1} alignItems="center" lineHeight={0}>
            <Icon
              sx={{
                fontWeight: "bold",
                color: ({ palette: { info } }) => info.main,
                // mt: -0.5,
              }}
              fontSize="large"
            >
              price_change
            </Icon>
            <SoftTypography variant="caption" fontWeight="regular" color="text">
              <strong> Mejora tu estrategia de pagos: </strong>calcula si te conviene cuotas o pago
              Ãºnico.
            </SoftTypography>
          </SoftBox>
        </SoftBox>
        <SoftBox color="text" px={2}>
          <Icon sx={{ cursor: "pointer", fontWeight: "bold" }} fontSize="small">
            restart_alt
          </Icon>
        </SoftBox>
      </SoftBox>
      <SoftBox
        component="form"
        role="form"
        display="flex"
        flexDirection="column"
        justifyContent="space-around"
        gap={2}
        pl={2}
        pr={2}
        pb={2}
      >
        <SoftBox>
          <SoftBox pl={1}>
            <SoftTypography variant="caption" fontWeight="regular" color="text">
              IngresÃ¡ el precio de contado
            </SoftTypography>
          </SoftBox>
          <SoftInput
            placeholder="1"
            icon={{
              component: "attach_money",
              direction: "right",
            }}
          />
        </SoftBox>
        <SoftBox>
          <SoftBox pl={1}>
            <SoftTypography variant="caption" fontWeight="regular" color="text">
              IngresÃ¡ el precio total en cuotas
            </SoftTypography>
          </SoftBox>
          <SoftInput
            placeholder="Type here..."
            icon={{
              component: "credit_card",
              direction: "right",
            }}
          />
        </SoftBox>
        <SoftBox>
          <SoftBox pl={1} display="flex" flexDirection="column" justifyContent="center">
            <SoftTypography variant="caption" fontWeight="regular" color="text">
              InflaciÃ³n mensual estimada
            </SoftTypography>
            <SoftTypography variant="overline" fontWeight="light" color="info">
              (8.4% Abril INDEC) - (163.2% anual)
            </SoftTypography>
          </SoftBox>
          <SoftInput
            placeholder="Type here..."
            icon={{
              component: "request_quote",
              direction: "right",
            }}
          />
        </SoftBox>
        <SoftBox>
          <SoftBox pl={1}>
            <SoftTypography variant="caption" fontWeight="regular" color="text">
              Cantidad de cuotas
            </SoftTypography>
          </SoftBox>
          <SoftInput
            placeholder="Type here..."
            icon={{
              component: "timeline",
              direction: "right",
            }}
          />
        </SoftBox>
      </SoftBox>
    </Card>
  );
};

export default Infleta;
